export interface IUser{
    id: number,
    role: string,
    name: string,
    lastName: string,
    quote: string,
    birthday: string,
    nativeCity: string,
    email: string, 
    status: string,
    freinds: any
}

export class User implements IUser{
    constructor(public id: number,
        public role: string,
        public name: string,
        public lastName: string,
        public quote: string,
        public birthday: string,
        public nativeCity: string,
        public email: string, 
        public status: string,
        public freinds: any){}
}
